            JSR  DELAY
            JMP  LOOPEND                             
DLY_F2      LDY  #45
            JSR  DELAY
            JMP  LOOPEND                        
DLY_F1      LDY  #882
            JSR  DELAY
            JMP  LOOPEND                        
DLY_F0      LDY  #735
            JSR  DELAY
            JMP  LOOPEND                        
DLY_VAR0    LDY  ,X++
            TFR  Y,D    ; Swap dumb little-endian word to big-endian
            EXG  A,B    ; (As nature intended.)
            TFR  D,Y
            JSR  DELAY
            JMP  LOOPEND
WR_BANK1    LDA  ,X+
            LDB  ,X+
            LDE  #1
            JSR  OPL_WRITE
            JMP  LOOPEND
WR_BANK0    LDA  ,X+
            LDB  ,X+
            LDE  #0
            JSR  OPL_WRITE
