            BNE  SONGLOOP
            LDA  #$00
            LDB  #$00
            LDE  #$00
            JSR  OPL_WRITE
            LDA  #$08
            LDB  #$40
            LDE  #$00
            JSR  OPL_WRITE
            LDA  #$BD
            LDB  #$00
